import { legacy_createStore } from "redux";
import { Provider } from "react-redux";
import { Outlet } from "react-router-dom";
import NavigationSidebar from "./navbar/navbar.js";
import navigationReducer from "./navbar/navbar-reducer.js";
import { ProfileProvider } from "./components/contexts/profile-context";
const store = legacy_createStore(navigationReducer);

const MemeWeb = () => {
  return (
    <Provider store={store}>
      <ProfileProvider>
        <div className="row mt-2">
          <div className="col-2 col-lg-1 col-xl-2">
            <NavigationSidebar />
          </div>
          <div className="col-10 col-lg-7 col-xl-6">
            <Outlet />
          </div>
          <div className="d-none d-lg-block col-lg-4 col-xl-4"></div>
        </div>
      </ProfileProvider>
    </Provider>
  );
};
export default MemeWeb;
